import {create} from 'zustand';

interface UserState {
  userID: number | null;
  email: string | null;
  setUserID: (userID: number | null) => void;
  setEmail: (email: string | null) => void; 
}


export const useUserStore = create<UserState>((set) => ({
  userID: null,
  email: null,
  setUserID: (userID) => set({ userID }),
  setEmail: (email) => set({ email }),
}));
